    static contextType = ThemeContext
    render() { 
        return (
            <div className="book-list">
                <ul>
                    <li>The way of kings</li>
                    <li>The wave</li>
                    <li>Love in the cholera time</li>
                </ul>

            </div>
        );
    }
}

export default Booklist;
